import './Form.css';
import { React, useEffect } from 'react';
import { useSelector, useDispatch } from 'react-redux';
import * as actions from '../../redux/actions';

export default function Form(props) {
    const dispatch = useDispatch();

    // useEffect(() => {
    //     dispatch(actions.getAllTemperaments())
    // }, [dispatch])

    // const temperaments = useSelector(store => store.temperaments)

    const { input, setInput, handleInputChange, setErrors, handleSubmit } = props;

    // const [input, setInput] = useState({
    //     name: '',
    //     image: '',
    //     temperaments: '',
    //     span: '',
    //     maxHeight: '',
    //     minHeight: '',
    //     maxWeight: '',
    //     minWeight: '',
    // });


    return (
        <div className="formDiv">
            <form onSubmit={handleSubmit}>
                <label>Name: </label>
                <input
                    className='inputGral'
                    name='name'
                    type="text"
                    placeholder='Name of the dog breed...'
                    onChange={handleInputChange}
                    value={input.name} />
                <hr />
                <label>Image: </label>
                <input
                    className='inputGral'
                    name='image'
                    placeholder='Copy the url of a cool image of the dog...'
                    type='text'
                    onChange={handleInputChange}
                    value={input.image} />
                <hr />
                <label>Life span: </label>
                <input
                    className='inputGral'
                    name='span'
                    type="text"
                    placeholder='How many years do this breed live...'
                    onChange={handleInputChange}
                    value={input.span} />
                <hr />
                <label>Height: </label>
                <input
                    className='inputGral'
                    name='minHeight'
                    type="number"
                    placeholder='Min height'
                    onChange={handleInputChange}
                    value={input.minHeight} />
                <label> - </label>
                <input
                    className='inputGral'
                    name='maxHeight'
                    type="number"
                    placeholder='Max height'
                    onChange={handleInputChange}
                    value={input.minHeight} />
                <label> cm.</label>
                <hr />
            </form>
        </div>
    )
}
